import React from 'react'
import "./header.css"
import { UserAuth } from '../context/AuthContext';
import {useNavigate} from 'react-router-dom';
import { FaSearchengin,FaBeer,bars } from 'react-icons/fa'


function Header({ fixed }) {
  const [navbarOpen, setNavbarOpen] = React.useState(false);
  const navigate = useNavigate();
  const { user,logout} = UserAuth();

  const handleLogout = async () => {
    try {
      await logout();
      navigate('/');
      console.log('You are logged out')
    } catch (e) {
      console.log(e.message);
    }
  };


  
  return (

<div>
    
    <nav className="relative flex flex-wrap items-center justify-between  px-2 py-3 bg-red-500 mb-3">
      <div className="container px-4 mx-auto flex flex-wrap items-center justify-between">
        <div className="w-full relative flex justify-between lg:w-auto lg:static lg:block lg:justify-start">
          <a
            className="text-sm font-bold leading-relaxed inline-block mr-4 py-2 whitespace-nowrap uppercase text-white"
            href="#pablo"
          >
            pink Tailwind Starter Kit
          </a>
          <button
            className="text-white cursor-pointer text-xl leading-none px-3 py-1 border border-solid border-transparent rounded bg-transparent block lg:hidden outline-none focus:outline-none"
            type="button"
            onClick={() => setNavbarOpen(!navbarOpen)}
          >
            <i className="fas fa-bars"><bars/></i>
          </button>
        </div>
        <div
          className={
            "lg:flex flex-grow items-center" +
            (navbarOpen ? " flex" : " hidden")
          }
          id="example-navbar-danger"
        >
          <ul className="flex flex-col lg:flex-row list-none lg:ml-auto">
            <li className="nav-item">
              <a
                className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75"
                href="#pablo"
              >
                <i className="fab fa-pinterest text-lg leading-lg text-white opacity-75"></i><span className="ml-2">Pin<FaBeer /></span>
                <FaSearchengin size='1.5rem' />
              </a>
            </li>
          </ul>
        </div>
      </div>
    </nav>

    </div>
    // <nav className='nav'> 
    //  <p>Welcome Teacher: {user && user.email}</p>
    //     <h2> shule web </h2>

    //     <button onClick={handleLogout} className='border px-6 py-2 my-4'>
    //     Logout
    //   </button>

    // </nav>
  )
}

export default Header
